    },
    {
      name: 'Advanced Security',
      description: 'Ac tincidunt sapien vehicula erat auctor pellentesque rhoncus. Et magna sit morbi lobortis.',
      icon: ShieldCheckIcon,
    },
    {
      name: 'Powerful API',
      description: 'Ac tincidunt sapien vehicula erat auctor pellentesque rhoncus. Et magna sit morbi lobortis.',
      icon: CogIcon,
    },
    {
      name: 'Database Backups',
      description: 'Ac tincidunt sapien vehicula erat auctor pellentesque rhoncus. Et magna sit morbi lobortis.',
      icon: ServerIcon,
    },
];

const EmployeeBenefitsPage = () => {
    return (
        <div>
            <HeaderBanner heading="Employee Benefits"/>

                <div className="relative bg-white py-16 sm:py-32 lg:py-20">
                    <div className="mx-auto max-w-md px-6 text-center sm:max-w-3xl lg:max-w-7xl lg:px-8">
                        <p className="mx-auto mt-5 max-w-prose text-xl text-gray-500">
                            Our clients benefit from big solutions that attract & retain employees, contractors, and part-time workers, all while increasingÂ profit.
                        </p>
                        <div className="mt-20">
                        <div className="grid grid-cols-1 gap-12 sm:grid-cols-2 lg:grid-cols-3">
                            {features.map((feature) => (
                            <div key={feature.name} className="pt-6">
                                <div className="flow-root rounded-lg bg-gray-50 px-6 pb-8">
                                <div className="-mt-6">
                                    <div>
                                    <span className="inline-flex items-center justify-center rounded-full bg-yellow-300 p-3 shadow-lg">
                                        <feature.icon className="h-8 w-8 text-black" aria-hidden="true" />
                                    </span>
                                    </div>
                                    <h3 className="mt-8 text-lg font-semibold leading-8 tracking-tight text-gray-900 text-left">
                                    {feature.name}
                                    </h3>
                                    <p className="mt-5 text-base leading-7 text-gray-600 text-left">{feature.description}</p>
                                </div>
                                </div>
                            </div>
                            ))}
                        </div>
                        </div>
                    </div>
                </div>

            <Slide bottom>
            <CallToAction/>
            <Footer/>
            </Slide>
        </div>
    )
}

export default EmployeeBenefitsPage;
